import { render } from 'react-dom';
import './style.css';
import { Simples, Composto, Main } from './convJuros.js';
import { CompoundInterest } from './jurosComp.js';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/';
import { simp, compo, menu} from "./botoes.js";
import App from './App';

export function Component1() {
  return (
    <p>
      Main
    </p>
  );
}

export function Component2() {
  return (
    <p>
      Compound Interest
    </p>
  );
}

export default function Home() {
  const [comp2Render, setComp2Render] = useState(2);

return (
  <div>
    <header>
      <div class="container" />
      <div id="logo">
        <img src="logo.png" alt="texto" height="400" width="400" />
      </div>
    </header>
    <div class="containerCentro1">
      <div class="containerCentro2">
        <div id="menu">

        <div className="App">
      <button onClick={() => setComp2Render(1)}>Render Component 1</button>
      <button onClick={() => setComp2Render(2)}>Render Component 2</button>
      </div>

        </div>
      </div>
    </div>
    <div id="principal">

      <div class="efeito">

        <div class="container">

        <CompoundInterest/>

        </div>
      </div>
    </div>
    <footer>Developed by Lucas Marinho</footer>
  </div>
)
}



render(<Home />, document.getElementById('root'));
